DROP TABLE IF EXISTS `tbds_role`;
CREATE TABLE `tbds_role` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(255) NULL, --
  `description` VARCHAR(500) NULL,
  `flag` VARCHAR(1) NULL,
  `created` DATETIME NULL,
  `modified` DATETIME NULL,
  PRIMARY KEY (`id`));

  
  drop table `tbds_permission`;
  CREATE TABLE `tbds_permission` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `action_key` VARCHAR(500) NULL,
  `node` VARCHAR(500) NULL,
  `type` VARCHAR(45) NULL,
  `text` VARCHAR(500) NULL,
  `created` DATETIME NULL,
  `modified` DATETIME NULL,
  PRIMARY KEY (`id`));

DROP TABLE IF EXISTS `tbds_user`;
  CREATE TABLE `tbds_user` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `username` VARCHAR(100) NULL, 
  `nickname` VARCHAR(255) NULL, 
  `password` VARCHAR(500) NULL, 
  `salt` VARCHAR(500) NULL, 
  `email` VARCHAR(500) NULL, 
  `mobile` VARCHAR(20) NULL, 
  `gender` VARCHAR(1) NULL, 
  `birthday` DATE NULL, 
  `company` VARCHAR(1000) NULL, 
  `status` VARCHAR(1) NULL, 
  `logged` DATETIME NULL, 
  `activated` DATETIME NULL,
  `created` DATETIME NULL, 
  `modified` DATETIME NULL,
  `flag` VARCHAR(1) NULL,
  PRIMARY KEY (`id`));
  


DROP TABLE IF EXISTS `tbds_role_permission_mapping`;

CREATE TABLE `tbds_role_permission_mapping` (
  `role_id` int(11) unsigned NOT NULL COMMENT '角色ID',
  `permission_id` int(11) unsigned NOT NULL COMMENT '权限ID',
  PRIMARY KEY (`role_id`,`permission_id`)
);


DROP TABLE IF EXISTS `tbds_user_role_mapping`;

CREATE TABLE `tbds_user_role_mapping` (
  `user_id` int(11) unsigned NOT NULL COMMENT '用户ID',
  `role_id` int(11) unsigned NOT NULL COMMENT '角色ID',
  PRIMARY KEY (`user_id`,`role_id`)
);

/**
 * 存放scheduler job template信息的数据表
 **/
CREATE TABLE `tbds_job_template` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `template_name` VARCHAR(255) NULL,
  `template_type` VARCHAR(255) NULL,
  `template_application` VARCHAR(255) NULL,
  `file_path` VARCHAR(500) NULL,
  `description` VARCHAR(1000) NULL,
  PRIMARY KEY (`id`)
);

/**
 * 	表：tbds_server
 *	字段：id,name,host,port,catalog([mps,]das,fss,dbs),description
 */
CREATE TABLE `tbds_server` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(255) NULL,
  `host` VARCHAR(100) NULL,
  `port` INT NULL,
  `catalog` VARCHAR(45) NULL COMMENT '[mps,]das,fss,dbs',
  `description` VARCHAR(500) NULL,
  PRIMARY KEY (`id`));
  
/**	表：tbds_job
 *	字段：id,
 *		source_id, source_name, source_host, source_port, source_type, 
 *		target_id, target_name, target_host, target_port, target_type, catalog, status（是否禁用：0：禁用，1：激活（一旦激活，就表示job等相关xml已生成））
 */
CREATE TABLE `tbds_job` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `job_name` varchar(255) DEFAULT NULL,
  `opr_type` varchar(100) DEFAULT NULL,
  `status` int(1) DEFAULT NULL COMMENT '0:disabled,1:generated job xml and activated',
  `description` varchar(500) DEFAULT NULL,
  `source_id` int(11) DEFAULT NULL,
  `source_name` varchar(500) DEFAULT NULL,
  `source_host` varchar(100) DEFAULT NULL,
  `source_port` int(11) DEFAULT NULL,
  `source_type` varchar(100) DEFAULT NULL,
  `target_id` int(11) DEFAULT NULL,
  `target_name` varchar(500) DEFAULT NULL,
  `target_host` varchar(100) DEFAULT NULL,
  `target_port` int(11) DEFAULT NULL,
  `target_type` varchar(100) DEFAULT NULL,
  `catalog` varchar(255) DEFAULT NULL,
  `is_on_template` int(1) DEFAULT NULL,
  `on_template_name` varchar(500) DEFAULT NULL,
  `job_file` varchar(1000) DEFAULT NULL,
  `job_chain_file` varchar(1000) DEFAULT NULL,
  `job_chain_order_file` varchar(1000) DEFAULT NULL,
  `job_chain_config_file` varchar(1000) DEFAULT NULL,
  `job_depend_file1` varchar(1000) DEFAULT NULL,
  `job_depend_file2` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`id`)
);

  

DROP TABLE IF EXISTS `tbds_event_error`;
CREATE TABLE `tbds_event_error` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `cpm` VARCHAR(500) NULL,
  `event_datetime` DATETIME NULL,
  `event_date` DATE NULL,
  `event_time` TIME NULL,
  `train` VARCHAR(255) NULL,
  `obcu` VARCHAR(255) NULL,
  `type` VARCHAR(255) NULL,
  `item` VARCHAR(255) NULL,
  `element` VARCHAR(255) NULL,
  `error_type` VARCHAR(500) NULL,
  `error_detail` VARCHAR(500) NULL,
  `ext_info` VARCHAR(500) NULL,
  PRIMARY KEY (`id`));

DROP TABLE IF EXISTS `tbds_event_value`;
CREATE TABLE `tbds_event_value` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `cpm` VARCHAR(500) NULL,
  `event_datetime` DATETIME NULL,
  `event_date` DATE NULL,
  `event_time` TIME NULL,
  `train` VARCHAR(255) NULL,
  `obcu` VARCHAR(255) NULL,
  `type` VARCHAR(255) NULL,
  `item` VARCHAR(255) NULL,
  `element` VARCHAR(255) NULL,
  `value1` VARCHAR(500) NULL,
  `value2` VARCHAR(500) NULL,
  `value3` VARCHAR(500) NULL,
  PRIMARY KEY (`id`));
  

